uint64_t binomial(int n, int k)
{
    if (k > n)
    {
        return 0;
    }
    
    return pre_binomial[(n * (n + 1) / 2) + k];
}

uint64_t sum_binomials(int n, int k)
{
    if (k >= n)
    {
        return ((uint64_t)1 << n);
    }
    
    return pre_sum_binomial[(n * (n + 1) / 2) + k];
}

